    if(loading){
        return <RotateLeftIcon/>
    }

    return (<>
    <ul className="list-group mb-4">
    {posts.map(post=>(
        <li key={posts.id}  className="list-group-item">{posts.title}</li>
    ))}


    </ul>
        </>
    )
}

export default Scroll
